import { Route, Routes } from 'react-router';
import GetAllCompanys from './GetAllCompanys';
import { NavBar } from './NavBar';
import DeleteCompany from './DeleteCompany';
import GetOneCompany from './GetOneCompany';
import UpdateCompany from './UpdateCompany';
import { BrowserRouter } from 'react-router-dom';
import { Footer } from '../Footer';
import AddCompany from './AddCompany';
import AddCustomer from './AddCustomer';
import {GetAllCustomers} from './GetAllCustomers';
import DeleteCustomer from './DeleteCustomer';
import GetOneCustomer from './GetOneCustomer';
import UpdateCustomer from './UpdateCustomer';

interface Props {
  token: string;
}

function HomeAdmin(props: Props) {
  return (
    <div className="HomeAdmin">
      <BrowserRouter>
        <Routes>
          <Route path='/' element={<NavBar />} />
          <Route path='/updateCompany' element={<UpdateCompany token={props.token} />} />
          <Route path='/getAllCompanys' element={<GetAllCompanys token={props.token} />} />
          <Route path='/deleteCompany' element={<DeleteCompany token={props.token} />} />
          <Route path='/getOneCompany' element={<GetOneCompany token={props.token} />} />
          <Route path='/addCompany' element={<AddCompany token={props.token} />} />
          <Route path='/updateCustomer' element={<UpdateCustomer token={props.token} />} />
          <Route path='/deleteCustomer' element={<DeleteCustomer token={props.token} />} />
          <Route path='/getAllCustomers' element={<GetAllCustomers token={props.token} />} />
          <Route path='/getOneCustomer' element={<GetOneCustomer token={props.token} />} />
          <Route path='/addCustomer' element={<AddCustomer token={props.token} />} />
        </Routes>
      </BrowserRouter>
      <Footer/>
    </div>
  );
}

export default HomeAdmin;
